import React from "react";
import "./Form.css";

function NewForm() {

    const userName='Username';


  return (
    <div>
        <h2>{userName}</h2>
      <input type="text"/>
      <input type="number"/>
      <button type="submit"></button>
    </div>
  );
}

export default NewForm;
